import styled from "styled-components";

function Footer() {
  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <FooterStyle>
          <div className="navbar-nav">
            <p style={{color: "#fff"}}>Hello</p>
          </div>
        </FooterStyle>
      </nav>
    </>
  );
}

const FooterStyle = styled.div`
  text-align: center;
  padding: 8px 0;
  position: fixed;
  bottom: 0;
  width: 100%;
`

export default Footer;
